//import './App.css';
import HomePage from './pages/HomePage';

function App() {
  return (
    <Router>
    <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/next" element={<NextPage />} />
    </Routes>
</Router>
  );
}

export default App;
